import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';
import CardList from './cardList';
import Card from './card';
import 'bootstrap/dist/css/bootstrap.min.css';
import { robots } from './robots';

ReactDOM.render(<div className="row">
        <Card id={ robots[1].id } username={ robots[1].username } name={ robots[1].name } email={ robots[1].email }  />
        <Card id={ robots[2].id } username={ robots[2].username } name={ robots[2].name } email={ robots[2].email }  />
        <Card id={ robots[3].id } username={ robots[3].username } name={ robots[3].name } email={ robots[3].email }  />
    </div>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
